Implement {{#with foo as bar}} syntax

With these changes to the {{#with}} helper, you
can now assign the value at the specified path
to a keyword.

If you do this, it does not change the scope,
but simply makes the value available within the
helper's block as a keyword.

For example:

    {{#with controller.stateManager as manager}}
      {{! title refers to the parent context }}
      {{title}}
      {{manager.currentState.name}}
    {{/with}}

